import React from 'react';
import UserStats from './UserStats';
import ArrowRight from '../../assets/images/arrow-right.svg';

function UserProgress() {
    return (
        <section className='px-10 bg-gray-50 py-10 w-full'>
            <h1 className='text-xl font-bold'>Welcome back, User!</h1>
            <div className='flex justify-between'>
                <div className='w-2/3'>
                    <div className='relative bg-primary text-white w-2/3 rounded-lg px-5 py-4 mx-auto mt-7'>
                        <h2 className='font-bold text-3xl text-white'>Baby Steps</h2>
                        <p className='font-semibold text-blue-100'>Master the fundamentals and build a strong foundation.</p>
                        <a href='' className='absolute right-5 bottom-2'><img src={ArrowRight} alt='continue learning' className='size-10' /></a>
                    </div>
                </div>
                <UserStats />
            </div>
        </section>
    );  
}

export default UserProgress;
